import {
    Box,
    Card,
    CardContent,
    CardMedia,
    Typography,
    Grid,
    Stack,
    Button,
  } from "@mui/material";
import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { config } from "../App";
import WhatshotOutlinedIcon from '@mui/icons-material/WhatshotOutlined';
import ScheduleOutlinedIcon from '@mui/icons-material/ScheduleOutlined';
import { Link } from "react-router-dom";
import './homepage.css'

import {  getRecipes } from "../features/recipeSlice";
const Homepage=()=>{
   const { recipes } = useSelector((state) => state.recipe);
   const dispatch = useDispatch();

  //  console.log(recipes)
//  const [recipe,setRecipe] = useState()

  useEffect(() => {
   getRecipe();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  const getRecipe = async () => {
    let response = {};
    let errored = false;

    try {
      response = await (
        await fetch(`${config.endpoint}/recipe`, {
          method: "GET",
        })
      ).json();
    } catch (e) {
      errored = true;
      return errored;
    }
    dispatch(getRecipes(response))
    return recipes
    // dispatch(getRecipe(response));
  };
  console.log(recipes)

  return (
    <div className="flip-card">
        <Box style={{display:"flex",justifyContent:"center"}} >
             {typeof recipes !== "undefined" && (
              <div className="flip-card-inner">
          <Grid container spacing={2} sx={{ m: 2 }} alignItems="stretch" justifyContent="center" style={{width:"80vw"}} >
            {recipes.map((ele) => {
              return (
                <div className="flip-card-front">
                <Grid item  xs={8} md={3} key={ele._id} className="recipe-grid">
                  <Link to={"/recipe/" + ele._id} className="recipe-tile-link" style={{textDecoration:"none"}}>
                    <Card className="recipe-tile" sx={{ maxWidth: 345 }}>
                    {/* <div className="overlay">
                        <div className="text">
                        <img src="https://drive.google.com/uc?export=view&id=1x0GCyvpqFAIJydPgxRMGCrMzU8jUhUaI" style={{height:"100px",filter:"invert(8%) sepia(75%) saturate(4737%) hue-rotate(355deg) brightness(97%) contrast(98%)"}}/> 
                        <div>
                       <Button variant="contained">let's cook</Button>
                          </div>
                        </div>
                      </div> */}
                      
                      <CardMedia
                        // style={{ height: "70%" }}
                        className="image"
                        sx={{ height: 200 }}
                        component="img"
                        image={ele.image}
                        alt={ele.title}
                      />
                     
                      <CardContent>
                        <Box>
                        <Typography
                          component="h5"
                          variant="h5"
                          className="nheadingrs"
                        >
                          {ele.title}
                          <span className="rsvegnonveg veg"><span className="veg"></span></span>
                        </Typography>
                       

                        </Box>
                        <Box style={{display:"flex",justifyContent:'space-between',padding:"10px"}}>
                        <Stack direction="row" alignItems="center">
                          <WhatshotOutlinedIcon style={{height:"20px" ,color:"red"}} />
                          <Typography
                            variant="subtitle1"
                            color="textSecondary"
                          >
                        {ele.calories}

                          </Typography>
                      </Stack>
                      <Stack direction="row" alignItems="center" gap="2px">
                        <ScheduleOutlinedIcon style={{height:"20px"}}/>
                          <Typography
                            variant="subtitle1"
                            color="textSecondary"
                          >
                            {ele.prepTime}
                          </Typography>
                        </Stack>
                          </Box>
                      </CardContent>
                    </Card>
                  </Link>
                </Grid>
                </div>
              );
            })}


<div class="flip-card-back">
      <h1>John Doe</h1> 
      <p>Architect & Engineer</p> 
      <p>We love that guy</p>
    </div>
          </Grid>

</div>



          )}

      </Box>
      </div>
    )
}
export default Homepage
